import Head from "next/head";

import Container from "react-bootstrap/Container";

const Home = () => {
  return (
    <div>
      <Head>
        <title>OJOS</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <Container>
        <Image
          fluid
          src="https://www.gamudacove.com.my/media/img/default-img.jpg"
        />
        <Image
          fluid
          src="https://www.gamudacove.com.my/media/img/default-img.jpg"
        />
      </Container>
    </div>
  );
};

export default Home;
